import React, { useEffect, useState } from 'react';
import { connect } from 'react-redux';

import PopCard from './PopCard';
import './PopCardListStyles.scss';

const mapStateToProps = (state) => {
	return {
		p_keyword: state.pkeyword.p_keyword
	}
}

function PopCardList (props) {
	const [popinfo, setPopinfo] = useState([]);
	var pkw = (JSON.stringify(props.p_keyword));
	pkw = pkw.substring(1, pkw.length-1);

	console.log(pkw)
	console.log("this is pkw")
	console.log(`/contemporary-search?q=${pkw}`)


  useEffect(() => {
    fetch(`/contemporary-search?q=die`)
    	.then(response => response.json())
    	.then(data => {setPopinfo(data);});
  }, []);

  console.log({popinfo})


	return(
		<div className='info-preview'>
			{
				popinfo && popinfo.map((artist, i) => {
					return (
						<PopCard 
						key={i} 
						id={popinfo[i].id} 
						name={popinfo[i].artist} 
						song={popinfo[i].name}
						album={popinfo[i].album}
						date={popinfo[i].date} 
						yt_url={popinfo[i].youtube}
						/>
					);
				})
			}
			{console.log({popinfo})}
			{console.log("this is pop card render")}
	   </div> 
	);
}



export default connect(mapStateToProps)(PopCardList);









